import React from "react";
import {
    DetailWrapper,
    Title,
    Content
} from "./detail_style";

class Detail extends React.Component{
    render(){
        return (
            <DetailWrapper>
                <Title>那些扎心的网易云热评（句句扎心）</Title>
                <Content></Content>
            </DetailWrapper>
        )
    }
}
export default Detail;
